// frontend/src/Components/Results.js
import React, { useState, useEffect } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import './Results.css';
import AudioUploader from './AudioUploader';
//import spectrogramImage from '/Trabajo de grado/ML/Notebooks/spectrogram.png';


const Results = () => {
    const [activeTab, setActiveTab] = useState('accuracy');
    const [result, setResult] = useState(null); // Para guardar los resultados del análisis
    const [comparativeData, setComparativeData] = useState(null);

    // Datos simulados para análisis comparativo
    useEffect(() => {
        fetchComparativeData();
    }, []);

    const fetchComparativeData = () => {
        setTimeout(() => {
            setComparativeData([
                { name: 'Quena', ML: 85, tradicional: 70 },
                { name: 'Bombo', ML: 78, tradicional: 85 },
                { name: 'Charango', ML: 92, tradicional: 88 },
                { name: 'Zampoña', ML: 88, tradicional: 75 },
            ]);
        }, 1500);
    };

    // Manejar los resultados después de la subida de audio
    const handleResult = (data) => {
        setResult(data);
        setActiveTab('results'); // Cambiar automáticamente a la pestaña de resultados
    };

    return (
        <div className="results">
            <h3>Clasificación de Instrumentos Andinos</h3>

            {/* Componente de subida de audio */}
            <AudioUploader onResult={handleResult} />

            {/* Pestañas */}
            <div className="tabs">
                <button className={activeTab === 'accuracy' ? 'active' : ''} onClick={() => setActiveTab('accuracy')}>
                    Precisión
                </button>
                <button className={activeTab === 'spectrogram' ? 'active' : ''} onClick={() => setActiveTab('spectrogram')}>
                    Espectrograma
                </button>
                <button className={activeTab === 'comparative' ? 'active' : ''} onClick={() => setActiveTab('comparative')}>
                    Análisis Comparativo
                </button>
                <button className={activeTab === 'results' ? 'active' : ''} onClick={() => setActiveTab('results')}>
                    Resultados
                </button>
            </div>

            {/* Contenido de cada pestaña */}
            {activeTab === 'accuracy' && (
                <div className="accuracy-content">
                    <h4>Precisión de Modelos</h4>
                    <ResponsiveContainer width="100%" height={300}>
                        <LineChart data={comparativeData || []}>
                            <CartesianGrid strokeDasharray="3 3" />
                            <XAxis dataKey="name" />
                            <YAxis />
                            <Tooltip />
                            <Legend />
                            <Line type="monotone" dataKey="ML" stroke="#8884d8" activeDot={{ r: 8 }} />
                            <Line type="monotone" dataKey="tradicional" stroke="#82ca9d" />
                        </LineChart>
                    </ResponsiveContainer>
                </div>
            )}

            {activeTab === 'spectrogram' && result && result.spectrogram && (
                <div className="spectrogram">
                    <h4>Espectrograma Generado</h4>
                    <img
                        src={`data:image/png;base64,${result.spectrogram}`}
                        alt="Espectrograma"
                        style={{ width: '100%', height: 'auto', border: '1px solid #FFD700' }}
                    />
                </div>
            )}

            {activeTab === 'comparative' && (
                <div className="comparative-analysis">
                    <h4>Análisis Comparativo</h4>
                    {comparativeData ? (
                        <ResponsiveContainer width="100%" height={300}>
                            <LineChart data={comparativeData}>
                                <CartesianGrid strokeDasharray="3 3" />
                                <XAxis dataKey="name" />
                                <YAxis />
                                <Tooltip />
                                <Legend />
                                <Line type="monotone" dataKey="ML" stroke="#8884d8" activeDot={{ r: 8 }} />
                                <Line type="monotone" dataKey="tradicional" stroke="#82ca9d" />
                            </LineChart>
                        </ResponsiveContainer>
                    ) : (
                        <div className="loading">Cargando análisis comparativo...</div>
                    )}
                </div>
            )}

            {activeTab === 'results' && result && (
                <div className="results-tab">
                    <h4>Resultados del Modelo</h4>
                    <p><strong>Instrumento Detectado:</strong> {result.instrument}</p>
                    <h5>Probabilidades:</h5>
                    <ul>
                        {result.probabilities.map((prob, index) => (
                            <li key={index}>Instrumento {index + 1}: {(prob * 100).toFixed(2)}%</li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
};

export default Results;
